import { GET_ALL_SUPPORT_TASKS } from "../actions/types";


const initialState = {
  tasks: []
}

export const adminReducer = (state: any = initialState, action: any) => {
  switch (action.type) {
    case GET_ALL_SUPPORT_TASKS:
      if (action.payload.message.toLowerCase() === 'not found') return state;
      return { ...state, tasks: action.payload }

    default:
      return state;
  }
}
